'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetSsoTokenCommand extends SendSingleCommandWithoutResponse {
    applicationName;
    providerName;
    requestNumber;
    constructor() {
        super();
        this.commandName = "GetSsoTokenCommand";
        this.providerName = "";
        this.requestNumber = 0;
    }
    createTransportMessage() {
        return this.messageFactory.createGetSsoTokenRequestMessage(this.tradingSession, this.applicationName, this.providerName, this.requestNumber, stdlib.nowutc());
    }
}
module.exports = GetSsoTokenCommand
